# determine whether there is an intersection
def isIntersection(x1, x2, x3, x4):
    if max(x1, x2) >= min(x3, x4) and max(x3, x4) >= min(x1, x2) \
            and max(x1, x2) >= min(x3, x4) and max(x3, x4) >= min(x1, x2):
        return True
    else:
        return False


