def fit_data(angle, numBig, numSmall):
    global arrayBig20, arrayBig25, arraySmall20, arraySmall25
    global arrayBig45, arrayBig50, arraySmall45, arraySmall50

    array_small_chazhi = []
    array_big_chazhi = []
    # Interpolation fitting to find an unknown dataset based on a known dataset
    if 20.0 < angle <= 25.0:
        array_small_chazhi = np.array(arraySmall20) - (np.array(arraySmall20) - np.array(arraySmall25)) * (
                (angle - 20.0) / 5.0)
        array_big_chazhi = np.array(arrayBig20) - (np.array(arrayBig20) - np.array(arrayBig25)) * ((angle - 20.0) / 5.0)
    elif 45.0 < angle <= 50.0:
        array_small_chazhi = np.array(arraySmall45) - (np.array(arraySmall45) - np.array(arraySmall50)) * (
                (angle - 45.0) / 5.0)
        array_big_chazhi = np.array(arrayBig45) - (np.array(arrayBig45) - np.array(arrayBig50)) * ((angle - 45.0) / 5.0)

    move_big_x = []
    move_big_y = []
    move_small_x = []
    move_small_y = []
    # i represents the y-axis     y-discrete point
    for i in range(0, 51):
        # j stands for the x-axis
        for j in range(0, 50):
            if array_big_chazhi[i][j] >= numBig > array_big_chazhi[i][j + 1]:
                # The piecewise linear method is used to find the equivalent
                # discrete point of the mutual inductance voltage corresponding to the type I mutual inductance voltage
                move_big_x.append(
                    (array_big_chazhi[i][j] - numBig) / (array_big_chazhi[i][j] - array_big_chazhi[i][j + 1]) + j)
                move_big_y.append(i)

    for i in range(0, 51):
        # j stands for the x-axis
        for j in range(0, 50):
            if array_small_chazhi[i][j] >= numSmall > array_small_chazhi[i][j + 1]:
                # The piecewise linear method is used to find the equivalent
                # discrete point of the mutual inductance voltage corresponding to the type II mutual inductance voltage
                move_small_x.append((array_small_chazhi[i][j] - numSmall) / (
                        array_small_chazhi[i][j] - array_small_chazhi[i][j + 1]) + j)
                move_small_y.append(i)

    return move_big_x, move_big_y, move_small_x, move_small_y


def get_test_data(path):
    test_data = []
    with open(path, 'r') as f:
        for line in f.readlines():
            data_dict = {'numBig': float(line.split(' ')[0]),
                         'numSmall': float(line.split(' ')[1]),
                         'angle': float(line.split(' ')[2]),
                         'x': float(line.split(' ')[3]),
                         'y': float(line.split(' ')[4])}
            test_data.append(data_dict)

    return test_data


