def fit(interpolated_big, interpolated_small, big, small):
    res_big = np.abs(interpolated_big - big)
    res_small = np.abs(interpolated_small - small)
    res = res_small + res_big
    min_index = np.unravel_index(np.argmin(res), res.shape)
    return [(min_index[1] / 500) * 50, (min_index[0] / 500) * 50]


